import { useState } from 'react';
const options = [
  { label: "Flat", value: "0" },
  { label: "Hilly", value: "1" },
  { label: "Forest", value: "2" },
  { label: "Mountains", value: "3" }
];

function TerrainSelector() {
  const [selectedOption, setSelectedOption] = useState(null);

  return (
      <select>
        <option value="grapefruit">Flat</option>
        <option value="lime">Hilly</option>
        <option selected value="coconut">Forest</option>
        <option value="mango">Mountains</option>
      </select>
  );
}

export default TerrainSelector;
